import React from "react";
// import { Link } from 'react-router-dom'
// import Navbar from "./Navbar";
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

const Home = () => (
  <Container isFluid padding="0">
    <Columns>
      <Columns.Column spreadMobile={6} spread={6} textAlign='center' alignSelf='center'>
         <Heading use='h2'> 
        console.log("Hi there!")<span role="img" aria-label="emojis">
          {" "}
          👋🏻👨🏻‍💻
        </span></Heading></Columns.Column>
      <Columns.Column spreadMobile={6} spread={6} paddingX='0'>
        <Image src={`/img/profile.JPG`} fit='cover' alt=''/>
      </Columns.Column>
    </Columns>
  </Container>
);

export default Home;
